import React from 'react'
import {NavLink} from 'react-router-dom'

export default function NavBar() {
    return (
        <nav>
            <ul>
                <li><NavLink to="/" activeStyle={{
                    color : "blue",
                    fontWeight : "bold",
                }} exact>Home</NavLink></li>
                <li><NavLink to="/about" activeStyle={{
                    color : "blue",
                    fontWeight : "bold"
                }} exact>About</NavLink></li>
                <li><NavLink to="/contact" activeStyle={{
                    color : "blue",
                    fontWeight : "bold"
                }} exact>Contact</NavLink></li>
                <li><NavLink to="/post/mobile" activeStyle={{
                    color : "blue",
                    fontWeight : "bold"
                }} exact>Post</NavLink></li>
            </ul>
        </nav>
    )
}
